import React from "react";

function TableRow(props) {
  const { srNo, accountNo, name, email, balance, contactNo, type } = props;

  return (
    <>
      <tr>
        <th scope="row">{srNo}</th>
        <td>{accountNo}</td>
        <td>{name}</td>
        <td>{email}</td>
        <td>$ {balance}</td>
        <td>{contactNo}</td>
        <td>{type}</td>
      </tr>
    </>
  );
}

export default TableRow;
